[{"operationName":"membershipQuery","variables":{},"query":"query membershipQuery($userId: String!) {
  EnterpriseAdminRolesV1Resource {
    byUser(userId: $userId) {
      elements {
        id
        managedLevelScope
        role
        thirdPartyOrganizationId
        programId
        __typename
      }
      __typename
    }
    __typename
  }
}
"},{"operationName":"DomainSubdomainQuery","variables":{"domainSlug":"computer-science","subdomainSlug":"na"},"query":"query DomainSubdomainQuery($domainSlug: String!, $subdomainSlug: String!) {
  DomainsV1Resource {
    slug(slug: $domainSlug) {
      elements {
        ...DomainFragment
        __typename
      }
      __typename
    }
    __typename
  }
  SubdomainsV1Resource {
    slug(slug: $subdomainSlug) {
      elements {
        ...SubdomainFragment
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment DomainFragment on DomainsV1 {
  description
  displayColor
  id
  name
  slug
  keywords
  backgroundImageUrl
  subdomains {
    elements {
      ...SubdomainFragment
      __typename
    }
    __typename
  }
  __typename
}

fragment SubdomainFragment on SubdomainsV1 {
  id
  domainId
  slug
  name
  description
  __typename
}
"}]
